import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/'); // Redirect to login if not logged in
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData) return <div>Loading...</div>;

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif", backgroundColor: "#f0f0f0", minHeight: "100vh" }}>
      <div style={{ display: "flex", justifyContent: "space-between", alignItems: "center" }}>
        <h1>Agent Dashboard</h1>
        <button onClick={handleLogout} style={{ padding: "5px 10px", cursor: "pointer" }}>Logout</button>
      </div>

      <h2 style={{ marginTop: "20px" }}>📝 Weekly Commission</h2>
      <table style={{ width: "100%", borderCollapse: "collapse", backgroundColor: "#fff" }}>
        <tbody>
          {Object.entries(commissionData).map(([key, value]) => (
            <tr key={key} style={{ borderBottom: "1px solid #ddd" }}>
              <td style={{ padding: "8px", fontWeight: "bold", textTransform: "capitalize" }}>{key.replace(/_/g, ' ')}:</td>
              <td style={{ padding: "8px" }}>{value || "N/A"}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <h2 style={{ marginTop: "40px" }}>⚠️ Scanning Violations & ARs</h2>
      {violationsData.length > 0 ? (
        <table style={{ width: "100%", borderCollapse: "collapse", backgroundColor: "#fff" }}>
          <thead>
            <tr style={{ backgroundColor: "#d32f2f", color: "#fff" }}>
              {Object.keys(violationsData[0]).map((header) => (
                <th key={header} style={{ padding: "8px", textTransform: "capitalize" }}>{header.replace(/_/g, ' ')}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            {violationsData.map((violation, index) => (
              <tr key={index} style={{ borderBottom: "1px solid #ddd" }}>
                {Object.values(violation).map((value, i) => (
                  <td key={i} style={{ padding: "8px" }}>{value || "N/A"}</td>
                ))}
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No violations found.</p>
      )}
    </div>
  );
}

export default Dashboard;
